}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Sara Cannon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1785:\"<p>A few weeks ago, Rangers Sara Cannon, Pete Mall, and Brian Krogsgard visited <a href=\"http://2014.chicago.wordcamp.org/\">Chicago</a> to attend WordCamp and strategize about our company&#8217;s goals for the year ahead.</p>\n<h3>Smart Design</h3>\n<p>Sara Cannon gave a presentation called Smart Design, where she highlights design trends and best practices that aid in creating outstanding user experiences. You can see her slides here:</p>\n<p>Smart Design</p>\n<p><iframe style=\"border: 1px solid #CCC; border-width: 1px 1px 0; margin-bottom: 5px; max-width: 100%;\" src=\"http://www.slideshare.net/slideshow/embed_code/35876030?rel=0\" width=\"597\" height=\"486\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"> </iframe></p>\n<div style=\"margin-bottom: 5px;\"><strong> <a title=\"Smart Design \" href=\"https://www.slideshare.net/saracannon/smart-design\" target=\"_blank\">Smart Design from Sara Cannon</a></strong></div>\n<h3>Range is hiring</h3>\n<p>We also announced while we were at WordCamp Chicago that we are hiring. If you are interested in working with us, please check out our <a title=\"We are hiring! | Looking for your new career?\" href=\"http://ran.ge/is/hiring/\">careers page</a>!</p>\n<h3>Good times</h3>\n<p>All in all, we had a great time, and it was a good time for our remote team leadership to get together, have fun, and strategize.</p>\n<p>Oh, and there was another picture too, but this one has WordPress lead developer Andrew Nacin photo-bombing us. Our thanks to <a href=\"http://www.kadamwhite.com/\">K. Adam White</a> for both pictures!</p>\n<p><img class=\"aligncenter size-large wp-image-4357\" src=\"http://s1.ran.ge/content/uploads/2014/07/range-nacin-bomb-665x500.jpg\" alt=\"range-nacin-bomb\" width=\"640\" height=\"481\" /></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"http://ran.ge/2014/07/08/range-goes-to-wordcamp-chicago/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:19:\"Range Restructuring\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"http://ran.ge/2014/06/02/range-restructuring/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"http://ran.ge/2014/06/02/range-restructuring/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 02 Jun 2014 15:38:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http: